        { id: 3, content: "长风破浪会有时" }]
      


export default class index extends Component {
    render() {
        const dcon=data.find((a)=>{
             return a.id===this.props.match.params.id
        })
        return (
            <div>
                <ul>
                   {
                       this.state.b.map((a)=>{
                           return(
                               <li>{dcon.content}</li>
                           )
                       })
                   }

                </ul>
            </div>
        )
    }
}
